script: |
  super -f text -I q4029.spq | sort > q4029.out

inputs:
  - name: q4029.spq
    data: |
      SELECT + + col0 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT + 96 * - CAST ( NULL AS INTEGER ) / + col1 * + + ( - col1 ) * + 26 BETWEEN - - 77 AND + 16;
  - name: tab2

outputs:
  - name: q4029.out
    data: |
